import React, { useState } from 'react';
import { useParams, Link } from 'react-router-dom';
import { ChevronDown, ChevronUp, Code, BarChart2, Heart, User } from 'lucide-react';

const HackEntry = ({ hack }) => (
  <div className="flex bg-white shadow-lg rounded-lg overflow-hidden mb-6">
    <div className="w-1/2 p-4">
      {/* Video placeholder */}
      <div className="bg-gray-300 h-48 mb-4 flex items-center justify-center">
        <span className="text-gray-600">Video Placeholder</span>
      </div>
      {/* Photo gallery */}
      <div className="grid grid-cols-5 gap-2">
        {[...Array(5)].map((_, index) => (
          <div key={index} className="bg-gray-200 h-16 flex items-center justify-center">
            <span className="text-xs text-gray-600">Photo {index + 1}</span>
          </div>
        ))}
      </div>
    </div>
    <div className="w-1/2 p-4">
      <h2 className="text-2xl font-bold mb-2">{hack.title}</h2>
      <p className="text-gray-600 mb-4">{hack.description}</p>
      <div className="flex flex-wrap gap-2">
        {hack.collaborators.map((collaborator, index) => (
          <Link 
            key={index} 
            to={`/profile/${collaborator.id}`} 
            className="inline-block px-3 py-1 rounded-full text-sm bg-blue-100 text-blue-800 hover:bg-blue-200"
          >
            {collaborator.name}
          </Link>
        ))}
      </div>
    </div>
  </div>
);

const LeftNavigation = ({ isTracksExpanded, setIsTracksExpanded }) => (
  <nav className="w-64 bg-white shadow-md h-full overflow-y-auto">
    <div className="p-5">
      <h2 className="text-2xl font-bold mb-5">Hackathon 2024</h2>
      <ul className="space-y-2">
        <li><Link to="/dashboard" className="block py-2 px-4 hover:bg-gray-100">Dashboard</Link></li>
        <li><Link to="/schedule" className="block py-2 px-4 hover:bg-gray-100">Schedule</Link></li>
        <li><Link to="/resources" className="block py-2 px-4 hover:bg-gray-100">Resources</Link></li>
        <li>
          <button 
            className="flex items-center justify-between w-full py-2 px-4 hover:bg-gray-100"
            onClick={() => setIsTracksExpanded(!isTracksExpanded)}
          >
            Tracks
            {isTracksExpanded ? <ChevronUp size={20} /> : <ChevronDown size={20} />}
          </button>
          {isTracksExpanded && (
            <ul className="pl-4">
              <li><Link to="/tracks/classic" className="flex items-center py-2 px-4 hover:bg-gray-100"><Code size={16} className="mr-2" /> Classic Track</Link></li>
              <li><Link to="/tracks/enterprise" className="flex items-center py-2 px-4 hover:bg-gray-100"><BarChart2 size={16} className="mr-2" /> Enterprise Track</Link></li>
              <li><Link to="/tracks/valentines" className="flex items-center py-2 px-4 hover:bg-gray-100"><Heart size={16} className="mr-2" /> Valentines Track</Link></li>
            </ul>
          )}
        </li>
        <li><Link to="/submissions" className="block py-2 px-4 hover:bg-gray-100">My Submissions</Link></li>
      </ul>
    </div>
  </nav>
);

const TrackHacksPage = () => {
  const { trackId } = useParams();
  const [isTracksExpanded, setIsTracksExpanded] = useState(false);

  // Sample data - in a real app, this would come from an API
  const sampleHacks = [...Array(10)].map((_, index) => ({
    id: index + 1,
    title: `${trackId} Hack Project ${index + 1}`,
    description: `This is a sample description for ${trackId} hack project ${index + 1}. It demonstrates the amazing creativity and innovation of our participants.`,
    collaborators: [
      { id: `user1_${index}`, name: 'John Doe' },
      { id: `user2_${index}`, name: 'Jane Smith' },
      { id: `user3_${index}`, name: 'Bob Johnson' },
    ]
  }));

  return (
    <div className="flex flex-col min-h-screen bg-gray-100">
      {/* Header */}
      <header className="bg-white shadow-md p-4 flex justify-between items-center">
        <span className="font-bold text-lg">John Doe</span>
        <Link to="/profile" className="flex items-center text-blue-600 hover:text-blue-800">
          <User size={20} className="mr-2" />
          Profile
        </Link>
      </header>

      <div className="flex flex-grow">
        {/* Left Navigation Pane */}
        <LeftNavigation isTracksExpanded={isTracksExpanded} setIsTracksExpanded={setIsTracksExpanded} />

        {/* Main Content Area */}
        <main className="flex-grow p-8 overflow-y-auto">
          <h1 className="text-3xl font-bold mb-6">{trackId} Track Submissions</h1>
          <div className="space-y-6">
            {sampleHacks.map(hack => (
              <HackEntry key={hack.id} hack={hack} />
            ))}
          </div>
        </main>
      </div>
    </div>
  );
};

export default TrackHacksPage;
